import React, { useState } from 'react';
import styles from './StyleSelector.module.css';

const profileImages = [
  { id: 1, image: process.env.PUBLIC_URL + '/assets1/profiles/profile1.png' },
  { id: 2, image: process.env.PUBLIC_URL + '/assets1/profiles/profile2.png' },
  { id: 3, image: process.env.PUBLIC_URL + '/assets1/profiles/profile3.png' },
  { id: 4, image: process.env.PUBLIC_URL + '/assets1/profiles/profile4.png' },
  { id: 5, image: process.env.PUBLIC_URL + '/assets1/profiles/profile5.png' },
  { id: 6, image: process.env.PUBLIC_URL + '/assets1/profiles/profile6.png' },
  { id: 7, image: process.env.PUBLIC_URL + '/assets1/profiles/profile7.png' }
];

const styleOptions = [
  { id: 1, name: 'Basic jumpers' },
  { id: 2, name: 'Warm puffer' },
  { id: 3, name: 'Bomber' },
  { id: 4, name: 'Biker jacket' }
];

const tools = [
  { 
    id: 'camera',
    icon: (
      <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M12 15.2C13.7673 15.2 15.2 13.7673 15.2 12C15.2 10.2327 13.7673 8.8 12 8.8C10.2327 8.8 8.8 10.2327 8.8 12C8.8 13.7673 10.2327 15.2 12 15.2Z" fill="currentColor"/>
        <path d="M9 3L7.17 5H4C2.9 5 2 5.9 2 7V19C2 20.1 2.9 21 4 21H20C21.1 21 22 20.1 22 19V7C22 5.9 21.1 5 20 5H16.83L15 3H9ZM12 17C9.24 17 7 14.76 7 12C7 9.24 9.24 7 12 7C14.76 7 17 9.24 17 12C17 14.76 14.76 17 12 17Z" fill="currentColor"/>
      </svg>
    )
  },
  { 
    id: 'layers',
    icon: (
      <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M11.99 18.54L4.62 12.81L3 14.07L12 21.07L21 14.07L19.37 12.8L11.99 18.54Z" fill="currentColor"/>
        <path d="M12 16L19.36 10.27L21 9L12 2L3 9L4.63 10.27L12 16Z" fill="currentColor"/>
      </svg>
    )
  },
  { 
    id: 'grid',
    icon: (
      <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M4 8H8V4H4V8ZM10 20H14V16H10V20ZM4 20H8V16H4V20ZM4 14H8V10H4V14ZM10 14H14V10H10V14ZM16 4V8H20V4H16ZM10 8H14V4H10V8ZM16 14H20V10H16V14ZM16 20H20V16H16V20Z" fill="currentColor"/>
      </svg>
    )
  },
  { 
    id: 'layout',
    icon: (
      <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M19 3H5C3.89 3 3 3.9 3 5V19C3 20.1 3.89 21 5 21H19C20.1 21 21 20.1 21 19V5C21 3.9 20.1 3 19 3ZM5 19V5H19V19H5Z" fill="currentColor"/>
        <path d="M7 7H17V9H7V7ZM7 11H17V13H7V11ZM7 15H14V17H7V15Z" fill="currentColor"/>
      </svg>
    )
  },
  { 
    id: 'wallet',
    icon: (
      <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M21 18V19C21 20.1 20.1 21 19 21H5C3.89 21 3 20.1 3 19V5C3 3.9 3.89 3 5 3H19C20.1 3 21 3.9 21 5V6H12C10.89 6 10 6.9 10 8V16C10 17.1 10.89 18 12 18H21ZM12 16H22V8H12V16ZM16 13.5C15.17 13.5 14.5 12.83 14.5 12C14.5 11.17 15.17 10.5 16 10.5C16.83 10.5 17.5 11.17 17.5 12C17.5 12.83 16.83 13.5 16 13.5Z" fill="currentColor"/>
      </svg>
    )
  },
  { 
    id: 'close',
    icon: (
      <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M19 6.41L17.59 5L12 10.59L6.41 5L5 6.41L10.59 12L5 17.59L6.41 19L12 13.41L17.59 19L19 17.59L13.41 12L19 6.41Z" fill="currentColor"/>
      </svg>
    )
  }
];

export default function StyleSelector({ onClose }) {
  const [selectedProfile, setSelectedProfile] = useState(null);
  const [selectedStyle, setSelectedStyle] = useState(1); // Default to Basic jumpers

  const handleProfileClick = (profileId) => {
    setSelectedProfile(profileId);
  };

  const handleStyleClick = (styleId) => {
    setSelectedStyle(styleId);
  };

  return (
    <div className={styles.container}>
      {/* Star icon in top left */}
      <svg className={styles.starIcon} viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M12 17.27L18.18 21L16.54 13.97L22 9.24L14.81 8.63L12 2L9.19 8.63L2 9.24L7.46 13.97L5.82 21L12 17.27Z" fill="currentColor"/>
      </svg>

      {/* Heart icon in top right */}
      <svg className={styles.heartIcon} viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M16.5 3C14.76 3 13.09 3.81 12 5.09C10.91 3.81 9.24 3 7.5 3C4.42 3 2 5.42 2 8.5C2 12.28 5.4 15.36 10.55 20.04L12 21.35L13.45 20.03C18.6 15.36 22 12.28 22 8.5C22 5.42 19.58 3 16.5 3ZM12.1 18.55L12 18.65L11.9 18.55C7.14 14.24 4 11.39 4 8.5C4 6.5 5.5 5 7.5 5C9.04 5 10.54 5.99 11.07 7.36H12.94C13.46 5.99 14.96 5 16.5 5C18.5 5 20 6.5 20 8.5C20 11.39 16.86 14.24 12.1 18.55Z" fill="currentColor"/>
      </svg>

      {/* Profile circles */}
      <div className={styles.profileCircles}>
        {profileImages.map((profile) => (
          <div 
            key={profile.id} 
            className={`${styles.profileCircle} ${selectedProfile === profile.id ? styles.selected : ''}`}
            onClick={() => handleProfileClick(profile.id)}
          >
            <img 
              src={profile.image} 
              alt={`Profile ${profile.id}`}
              onError={(e) => {
                e.target.src = '/images/placeholder.png';
                e.target.onerror = null;
              }}
            />
          </div>
        ))}
      </div>

      {/* Main content */}
      <div className={styles.mainContent}>
        <div className={styles.imageWrapper}>
          <img 
            src={process.env.PUBLIC_URL + '/assets1/man1.png'}
            alt="Style Preview"
            className={styles.mainImage}
            onError={(e) => {
              console.error('Failed to load main image');
              e.target.src = '/images/placeholder.png';
              e.target.onerror = null;
            }}
          />
        </div>
      </div>

      {/* Tools menu */}
      <div className={styles.toolsMenu}>
        {tools.map((tool) => (
          <button 
            key={tool.id}
            className={styles.toolButton}
            onClick={() => tool.id === 'close' && onClose?.()}
          >
            {tool.icon}
          </button>
        ))}
      </div>

      {/* Style options */}
      <div className={styles.styleOptions}>
        {styleOptions.map((style) => (
          <button 
            key={style.id} 
            className={`${styles.styleButton} ${selectedStyle === style.id ? styles.selected : ''}`}
            onClick={() => handleStyleClick(style.id)}
          >
            {style.name}
          </button>
        ))}
      </div>

      {/* Camera button */}
      <button className={styles.cameraButton}>
        <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M12 15.2C13.7673 15.2 15.2 13.7673 15.2 12C15.2 10.2327 13.7673 8.8 12 8.8C10.2327 8.8 8.8 10.2327 8.8 12C8.8 13.7673 10.2327 15.2 12 15.2Z" fill="currentColor"/>
          <path d="M9 3L7.17 5H4C2.9 5 2 5.9 2 7V19C2 20.1 2.9 21 4 21H20C21.1 21 22 20.1 22 19V7C22 5.9 21.1 5 20 5H16.83L15 3H9ZM12 17C9.24 17 7 14.76 7 12C7 9.24 9.24 7 12 7C14.76 7 17 9.24 17 12C17 14.76 14.76 17 12 17Z" fill="currentColor"/>
        </svg>
      </button>

      {/* Bottom navigation */}
      <div className={styles.bottomNav}>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>👔</span>
          <span>Collar</span>
        </div>
        <div className={`${styles.navItem} ${styles.active}`}>
          <span className={styles.navIcon}>👕</span>
          <span>Styles</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>👖</span>
          <span>Pant</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>🧥</span>
          <span>Coat</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>👜</span>
          <span>Accessories</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>🔧</span>
          <span>Tools</span>
        </div>
      </div>
    </div>
  );
}
